import React from 'react';
import Input from '../Input';

const ModalAdd = () => {
  return (
    <div>
      <Input type="text" placeholder="Filme" />
      <Input type="text" />
      <Input type="text" />
      <Input type="text" />
    </div>
  );
};

export default ModalAdd;
